import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <main className="container">
        <h1 className="text-Black text-uppercase text-center my-4">Connor</h1>
        <div class='some-page-wrapper'>
          <div class='row'>
            <div class='column'>
              <div class='blue-column'>
                Some Text in Column One
              </div>
            </div>
            <div class='column'>
              <div class='green-column'>
                Some Text in Column Two
              </div>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
